INSERT INTO RefDocumentFormat (ID,FORMATCODE,FORMATDESCRIPTION) VALUES (1,'BIDDING SECURITY A','<div style="text-align: right"><CURRENT_DATE></div><div><span style="font-weight: bold; text-transform: uppercase;"><EXPORTER_NAME></span><br/><div style="text-transform: capitalize;"><EXPORTER_ADDRESS></div><br><span style="font-weight: bold;">ATTN: <ATTN_NAME><span><br><span><ATTN_ADDRESS></span></div><br/><div style="font-weight: bold; text-align: center; text-transform: capitalize;"><FORM_OF_DOCUMENTARY_CREDIT> Domestic Letter of Credit No. <DOCUMENT_NUMBER></div><br/><div><span style="font-weight: bold;">Gentlemen and/or Ladies:</span><br/><br/><div style="text-indent: 4em; text-align: justify">WHEREAS, <span style="text-transform: uppercase; font-weight: bold;"><IMPORTER_NAME>, </span>with office address at <span style="text-transform: capitalize;"><IMPORTER_ADDRESS></span> (hereinafter called the "Bidder") has submitted his bid for the <PURPOSE_OF_STANDBY> (hereinafter called the "Bid").</div><br/><div style="text-indent: 4em; text-align: justify;">KNOW ALL MEN by these presents that WE, United Coconut Planters Bank, having our registered office at Trade Services Department, UCPB Executive Offices, Makati Avenue, Makati City (hereinafter called the ï¿½Bankï¿½), are bound unto <span style="text-transform: capitalize; font-weight: bold;"><EXPORTER_NAME> </span>(hereinafter called the "Entity") in the sum of <span style="text-transform: capitalize; font-weight: bold;"><AMOUNT_IN_WORDS> (<AMOUNT>)</span> for which payment well and truly to be made to the said Entity, the Bank binds himself, his successors, and assigns by these present.</div><br/><div style="text-indent: 4em; text-align: justify;">SEALED with the Common Seal of the Bank this <span style="font-weight: bold;"><PROCESS_DATE_FINANCIAL>.</span></div><br/><div style="text-indent: 4em; text-align: justify;">THE CONDITIONS of this obligations are:</div><br/><div style="text-align: justify; margin-left: 6em;">1. If the Bidder:</div><br/><div style="text-indent: 2em; text-align: justify; margin-left: 6em;">(a) withdraws his Bid during the period of bid validity specified in the Form of Bid; or</div><br/><div style="text-indent: 2em; text-align: justify; margin-left: 6em;">(b) does not accept the correction of arithmetical errors of his bid price in accordance with the Instructions to Bidder; or</div><br/><div style="text-align: justify; margin-left: 6em;">2. If the Bidder having been notified of the acceptance of his Bid by the Employer during the period of bid validity:</div><br/><div style="text-indent: 2em; text-align: justify; margin-left: 6em;">(a) fails or refuses to execute the Contract Form in accordance with the Instructions to Bidders, if required; or</div><br/><div style="text-indent: 2em; text-align: justify; margin-left: 6em;">(b) fails or refuses to furnish the Performance Security in accordance with the Instructions to Bidders.</div><br/><div style="text-indent: 4em; text-align: justify;">We undertake to pay the Entity up to the above amount upon receipt of his notarized first written demand, without the Entity having to substantiate his demand, provided that in his demand the Entity will note the amount claimed by him is due to him, owing to the occurrence of one or both of the two (2) conditions, specifying the occurred condition or conditions.</div><br/><div style="text-indent: 4em; text-align: justify;">This guarantee shall remain in force up to period of 120 days <span style="font-weight: bold;"><EXPIRY_DATE></span>, and any demand in respect thereof should reach the Bank not later than the above date.</div><br/><div style="text-indent: 4em; text-align: justify;">This Letter of Credit shall be governed by and construed in accordance with the laws of the Republic of the Philippines. Further, except so far as otherwise expressly stated, this Letter of Credit is subject to the International Standby Practices ISP98, and any subsequent revisions thereof.</div></div><br/><br/><div style="font-weight: bold; text-align: center;">Very truly yours,<br/><br/><br/><div style="width: 45%; float: left; font-weight: bold;">_________________________<br/>LETICIA C. MEJOS<br/>Assistant Vice President</div><div style="width: 45%; float: right; font-weight: bold;">_________________________<br/>JUSTINIANO M. BABATE<br/>Assistant Manager</div></div>');
INSERT INTO RefDocumentFormat (ID,FORMATCODE,FORMATDESCRIPTION) VALUES (2,'BIDDING SECURITY H','<center style="font-weight: bold;">BANK GUARANTEE<br/><DOCUMENT_NUMBER></center><p style="text-align: justify"><br/>WHEREAS, <IMPORTER_NAME> (Bidder Employee), doing business under the name and style of <span style="font-weight: bold;">__________</span>, with postal address at <IMPORTER_ADDRESS> (hereinafter called ï¿½the Bidderï¿½) has submitted her bid for the <PURPOSE_OF_STANDBY> (hereinafter called ï¿½the Bidï¿½).</p><p style="text-align: justify"><br/>KNOW ALL MEN by these presents that We, United Coconut Planters Bank, "(Branch)" having our registered office at "(Branch Address)" (hereinafter called ï¿½the Bankï¿½) are bound unto <EXPORTER_NAME> (hereinafter called ï¿½the Entityï¿½) in the sum of <span style="font-weight: bold;"><AMOUNT_IN_WORDS> (<AMOUNT>)</span> for which payment will and truly to be made to the said Entity the Bank binds itself, its successors and assigns by these presents.</p><p style="text-align: justify"><br/>SEALED with the Common Seal of the Bank this <PROCESS_DATE_FINANCIAL>.</p><p><br/>THE CONDITIONS of this obligation are:</p><p style="padding-left: 30px; text-align: justify">1. If the Bidder:</p><p style="padding-left: 50px; text-align: justify">A. withdraws its Bid during the period of bid validity specified in the Form of Bid; or</p><p style="padding-left: 50px; text-align: justify">B. Does not accept the correction of arithmetical errors of its bide price in accordance with the Instructions to Bidder; or</p><p style="padding-left: 30px; text-align: justify"><br/>2. If the Bidder having been notified of the acceptance of his bid by the Entity during the period of bid validity:</p><p style="padding-left: 50px; text-align: justify">A. Fails or refuses to execute the Contract Form in accordance with the Instructions to Bidders, if required; or</p><p style="padding-left: 50px; text-align: justify">B. Fails or refuses to furnish the Performance Security in accordance with the Instructions to Bidders.</p><p style="text-align: justify;"><br/><br/>We undertake to pay the Entity up to the above amount upon receipt of his first written demand, without the Entity having to substantiate his demand, provided that in his demand the Entity will note that amount claimed by him is due to him owing to the occurrence of any or all of the three(3) conditions, specifying the occurred condition or conditions.</p><p style="text-align: justify;"><br/>The Guarantee will remain in force up to <EXPIRY_DATE>. Any demand in respect of this Guarantee should reach the Bank not later than the above date.</p><center><br/><br/><br/>________________________________________<br/>Branch Manager or Bank Authorized Signatory<br/>Date: </center><p style="text-align: justify;"><br /><br />SUBSCRIBED AND SWORN TO before me this __________  day of __________, "(Year)", affiant exhibited to me his/her Community Tax Certificate No. __________ issued on __________, "(Year)" at __________.</p><br /><br /><table><tr><td>Doc No.</td><td>__________</td></tr><tr><td>Page No.</td><td>__________</td></tr><tr><td>Book No.</td><td>__________</td></tr><tr><td>Series of</td><td>__________</td></tr></table>');
